import Layout from '../Templates/Layout';

const HomePage = () => {
  return (
    <Layout>
      <div className="container-fluid text-center">
        <h1 className="pt-5 display-4">PeerPrep</h1>
        <p className="pt-5">Acing tech interviews2 at a time</p>




      </div>







    </Layout>
  );
};

export default HomePage;
